import { render } from "react-dom";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Todo from "./routes/Todo";

function App() {
	<BrowserRouter>
		<Routes>
			<div>
				<Link
					to="/"
					element={<Todo />}
				/>
			</div>
		</Routes>
	</BrowserRouter>;
}

export default App;
